const Kuk = {
    kuk: [],
    antallKuker: 0,

    addKuk: function(kuk) {
        this.kuk.push(kuk);
        this.antallKuker++;
    },

    getKuker: function() {
        return this.kuk;
    }

}

export default Kuk;
